	add("marae", "{\"term\":\"marae\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Polynesian.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a Polynesian sacred altar or enclosur\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: The path ended down by the sea at a crumbling ‘ingot’ of black coral, twenty yards in length \u0026amp; in height two men. ‘A \u0027\u0027\u0027marae\u0027\u0027\u0027, this is called,’ Mr Wagstaff informed me. ‘All over the South Seas you see ’em, I’m told.’ — David Mitchell, \u0027Cloud Atlas\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the courtyard of a Maori wharenui or meeting-house and the buildings around it\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marabaraba", "{\"term\":\"marabaraba\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shangaan: marabaraba\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An African board game, still played regularly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We rest at the viewpoint after an easy hour of walking, and our guide teaches us some finer points of \u0027\u0027Marabaraba\u0027\u0027, a board game hastily drawn on a sandstone rock, with little stones for “cows”.\u0027 [http://www.seelesotho.com/travel/cities/towns_menu.htm\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The murals, themselves subject to the cycle of nature and life, are an impermanent art, requiring annual renewal because they are washed off by the rain. Some mural designs depict objects such as women\u0027s coiffure, initiation masks or the board for \u0027\u0027marabaraba\u0027\u0027, a popular game like checkers, van Wyk said.\u0027 [http://www.columbia.edu/cu/record/archives/vol20/vol20_iss6/record2006.17.html\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"http://www.sahistory.org.za/pages/classroom/pages/guidelines-mapungubwe.htm\", \"priority\":4}]}, \"synonyms\":{}}");

