	add("marabout", "{\"term\":\"marabout\", \"etymology\":{\"influencers\":[], \"languages\":[\"moroccan arabic\", \"English\", \"French\", \"Portuguese\"], \"text\":\"From French \u0027marabout\u0027 from Portuguese \u0027\u0027 \u0027\u0027 from Moroccan arabic \u0027مْرَابِط\u0027 (standard Arabic \u0027مُرَابِط\u0027 (soldier stationed in fortified outpost) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Muslim holy man or mystic, especially in parts of North Africa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"one of their principal targets was the \u0027\u0027\u0027marabouts\u0027\u0027\u0027 – or holy men and leaders of mystic orders – whom they accused both of corrupting the faith by their espousal of mysticism and of being the ‘domestic animals of colonialism’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tomb or shrine of such a person\", \"priority\":4}]}, \"synonyms\":{}}");

