	add("marasmus", "{\"term\":\"marasmus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|μᾰρασμός||withering}}, from {{m|grc|μᾰραίνω||to waste, wither}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any wasting disease, especially a severe loss of body weight, in children, caused by malnutrition or the inability to digest protein\", \"priority\":1}]}, \"synonyms\":{}}");

