	add("marble", "{\"term\":\"marble\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman and Old french (842-ca. 1400) \u0027marbre\u0027 from Latin \u0027marmor\u0027 from Ancient greek (to 1453) \u0027μάρμαρος\u0027 perhaps related to \u0027μαρμάρεος|lang\u003dgrc\u0027 () Much of the early classical marble came from the \u0027Marmaris\u0027 sea above the Aegean. The forms from French replaced Old english (ca. 450-1100) \u0027marma\u0027 which had previously been borrowed from Latin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rock of crystalline limestone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1751\u0027\u0027, (librettist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Open thy \u0027\u0027marble\u0027\u0027 jaws, O tomb / And hide me, earth, in thy dark womb\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small spherical ball of rock, glass, ceramic or metal used in children\u0027s games\", \"priority\":4}]}, \"synonyms\":{}}");

