	add("march", "{\"term\":\"march\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|March|March(e)}}, from Anglo-norman {{m|fro|Marche}}, from Old french (842-ca. 1400) {{m|fro|marz}}, from Latin {{m|la|mārtius|gloss\u003dmonth of the god Mars}}, from earlier {{m|la|Mavors}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The third month of the Gregorian calendar, following February and preceding April. Abbreviation: \u0027\u0027Mar\u0027\u0027 or \u0027\u0027Mar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"for someone born in March, or for someone living near a boundary\", \"priority\":2}]}, \"synonyms\":{}}");

