	add("maréchaussée", "{\"term\":\"maréchaussée\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027maréchaussée\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of local guard force, especially in France, commanded by a marshal; loosely, the police, the constabulary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1789\u0027\u0027, letter, 6 Feb 1780\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I do not unite the \u0027\u0027\u0027Maréchaussée\u0027\u0027\u0027, because that corps is destined for a particular service, to which it will be altogether applied in the course of the next campaign, nor should I think it advisable to convert it to any other purpose\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, \u0027Miranda\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"‘Malediction,’ he muttered to himself, but then, with that peculiar command over himself which rarely quitted him, he at once recovered, and moved towards the two officers of the \u0027\u0027maréchaussée\u0027\u0027, now semi-inebriated\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 156\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Peasant communities were often effectively self-policing, while the newly reorganized \u0027\u0027\u0027maréchaussée\u0027\u0027\u0027 served as an ancillary peace-keeping force.Category:English terms spelled with É\", \"priority\":7}]}, \"synonyms\":{}}");

	add("mareel", "{\"term\":\"mareel\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old norse\", \"norn\"], \"text\":\"From an unattested Norn term *\u0027\u0027 (mareld) from Old norse \u0027mǫrueldr\u0027 from \u0027marr\u0027 (sea) + \u0027eldr\u0027 (fire) Compare Icelandic \u0027maurildi\u0027 Swedish \u0027mareld\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Phosphorescence on the ocean\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027, \u0027The Scots Magazine\u0027, volume 65, page 200\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This is especially the case in late summer when the sea is aflame with \u0027\u0027mareel\u0027\u0027 and the boats come and go with illumined wakes while the ghostly fire drips from the oar-blades\", \"priority\":3}]}, \"synonyms\":{}}");

