	add("margin", "{\"term\":\"margin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027margin-\u0027 oblique stem of \u0027margo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The edge of the paper that remains blank\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The edge or border of any flat surface\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The lobule \u0027\u0027margins\u0027\u0027, furthermore, are arched away from the lobe, with the consequence that (when fully inflated) the abaxial leaf surface forms the interior lining of the lobule\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The edge defining inclusion in or exclusion from of a set or group\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Pierre François, \u0027Inlets of the Soul: Contemporary Fiction in English and the Myth of the Fall, [http://books.google.com.au/books?id\u003dgNd4Asw3Lk8C\u0026amp;pg\u003dPA186\u0026amp;dq\u003d%22+margin+of+society%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dV2uoT4bFIOHWmAWp5OnACg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22%20margin%20of%20society%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 186\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As far as space is concerned, Mary Lamb finds herself at the farthest \u0027\u0027margin\u0027\u0027 of society - among tramps - when the novel begins\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A difference between results, characteristics, scores\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A permissible difference; allowing some freedom to move within limits\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"margin of error\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The yield or profit; the selling price minus the cost of production\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Collateral security deposited with a broker to secure him from loss on contracts entered into by him on behalf of his principial, as in the speculative buying and selling of stocks, wheat, etc\", \"priority\":12}]}, \"synonyms\":{}}");

	add("marginalism", "{\"term\":\"marginalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|marginal|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of marginal analysis to solve large classes of microeconomic problems\", \"priority\":1}]}, \"synonyms\":{}}");

