	add("margot", "{\"term\":\"margot\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027margot\u0027 diminutive of \u0027marguerite\u0027 (margaret)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027 w:Anne Anne Tyler, \u0027 A Patchwork Planet\u0027, A.A.Knopf Inc., page 3\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;I like names that end with an a, don\u0027t you? Or other vowels? Most often it seems to be an a. But wait: Margo\u0027s name ends with an o, for mercy\u0027s sake! Barnaby\u0027s mother. Or it used to be o. Then she met Barnaby\u0027s father and added a t.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sophia looked at me. I told her, \u0026quot;Mom thought \u0027\u0027Margot\u0027\u0027 with a t was higher class.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;First time I saw it written that way was on the wedding invitations,\u0026quot; Gram said. \u0026quot;She brought them home from the printer\u0027s and I said, \u0027Who\u0027s this?\u0027 She said, \u0027That\u0027s me.\u0027 Well, I did try to accommodate. Her dad said it was stuff and nonsense, but I told Jeffrey the next time he came to call, \u0027Mar-gott will be down in a minute.\u0027 He laughed because he thought I was joking but I was serious. I honestly assumed people pronounced the t.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("margravate", "{\"term\":\"margravate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|margrave|ate|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A territory governed by a margrave or margravine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Vanished Kingdoms\u0027, Penguin 2012, p. 174\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"From 1032 Provence had been a \u0027\u0027margravate\u0027\u0027 of the Holy Roman Empire in the imperial Kingdom of Burgundy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("margrave", "{\"term\":\"margrave\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"old high german (ca. 750-1050)\", \"Dutch\"], \"text\":\"From Middle dutch (ca. 1050-1350) \u0027marcgrave\u0027 (modern Dutch \u0027markgraaf\u0027 , cognate with Old high german (ca. 750-1050) \u0027marcgrāvo\u0027 (modern German \u0027markgraf\u0027 , from the Germanic bases of \u0027mark\u0027 () + \u0027grave\u0027 () Compare \u0027\u0027 \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feudal era military-administrative officer of comital rank in the Carolingian empire and some successor states, originally in charge of a border area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027: Among pulverised heads of stone \u0027\u0027margraves\u0027\u0027 and electors, reconnoitering a likely-looking cabbage patch, all of a sudden Slothrop picks up the scent of an unmistakable no it can’t be yes it is it’s a REEFER! — Thomas Pynchon, \u0027Gravity’s Rainbow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hereditary ruling prince in certain feudal states of the Holy Roman Empire and elsewhere; the titular equivalent became known as marquis or marquess\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1516\u0027\u0027: The \u0027\u0027Margrave\u0027\u0027 of Bruges was their head. — Thomas More, \u0027Utopia\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d497202666\u0026amp;tag\u003dMore,+Thomas,+Sir,+Saint,+1478-1535.:+Utopia,+1516\u0026amp;query\u003dmargrave\u0026amp;id\u003dMorUtop Chapter 1\", \"priority\":4}]}, \"synonyms\":{}}");

