	add("marihoochie", "{\"term\":\"marihoochie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Marijuana\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Bradley M. Fralick, \u0027Through My Head: Essays by a Brain Injury Survivor\u0027, Xlibris (2000), ISBN 9781477176702, [http://books.google.com/books?id\u003dxsnoDUdSvO0C\u0026amp;pg\u003dPT126\u0026amp;dq\u003d%22marihoochie%22 unnumbered page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And it\u0027s all because of those innocent little tokes on that pipeful of \u0027\u0027MARIHOOCHIE\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Poe Ballantine, \u0027God Clobbers Us All\u0027, Hawthorne Books (2004), ISBN 9780983304944, [http://books.google.com/books?id\u003d3K1qABlHlTQC\u0026amp;pg\u003dPT135\u0026amp;dq\u003d%22marihoochie%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Slowly I reach toward my cigarette pack for the \u0027\u0027marihoochie\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Robert Andrew Mannie, \u0027Dolphin Days\u0027, Xlibris (2013), ISBN 9781483613055, [http://books.google.com/books?id\u003dxIc_wRzU9MoC\u0026amp;pg\u003dPT23\u0026amp;dq\u003d%22marihoochie%22 page 23\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Would you like to smoke some \u0027\u0027marihoochie\u0027\u0027?” Indio asked her\", \"priority\":7}]}, \"synonyms\":{}}");

	add("marijuana", "{\"term\":\"marijuana\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"{{wikipedia}}{{wikipedia|Marijuana (word)}}From Mexican Spanish {{m|es|marihuana}}, from {{m|es|mariguan}}. First attested from 1894 of uncertain origin; possibly from {{m|nah|mallihuan||prisoner}}.Alteration by influence of the proper name {{m|es|María Juana||Mary Jane}} is believed to be folk etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Drug smoked or ingested for euphoric effect, \u0027w:Cannabis Cannabis (drug\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After smoking a bowl of that fine \u0027\u0027marijuana\u0027\u0027, they ate some brownies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The hemp plant itself, \u0027w:Cannabis Cannabis sativa\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marimba", "{\"term\":\"marimba\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Portuguese\"], \"text\":\"From Portuguese via a source, perhaps \u0027marimba\u0027 (xylophone)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical instrument similar to a xylophone but clearer in pitch\", \"priority\":1}]}, \"synonyms\":{}}");

