	add("marish", "{\"term\":\"marish\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mareis\u0027 \u0027\u0027 Middle french (ca. 1400-1600) \u0027mares\u0027 \u0027\u0027 from \u0027\u0027 from Proto-germanic {{m|gem-pro|*mariskaz||marsh}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marsh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thenne sir Tristram departed / and in euery place he asked \u0026amp; demaunded after sir Launcelot / but in no place he coude not here of hym whether he were dede or on lyue // Soo syr Tristram rode by a forest and then̄e was he ware of a fayre toure by a \u0027\u0027mareyse\u0027\u0027 on that one syde / and on that other syde a fayr medowe\u0026lt;!--Prior quote::So Sir Trystram rode by a foreyste, and than was he ware of a fayre toure by a \u0027\u0027marys\u0027\u0027 on the tone syde, and on that other syde was a fayre medow--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1667\u0027\u0027, \u0027\u0027, Book XII\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Cherubim descended; on the ground / Gliding meteorous, as evening-mist / Risen from a river o\u0027er the \u0027\u0027marish\u0027\u0027 glides, / And gathers ground fast at the labourer\u0027s heel / Homeward returning\", \"priority\":4}]}, \"synonyms\":{}}");

	add("marist", "{\"term\":\"marist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027mariste\u0027 from \u0027marie\u0027 (mary) + \u0027-iste\u0027 (-ist)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of any of several Roman Catholic organizations named after the Virgin Mary\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marjoram", "{\"term\":\"marjoram\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"French\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\", \"Portuguese\", \"Sanskrit\"], \"text\":\"From Old french (842-ca. 1400) \u0027majorane\u0027 (compare French \u0027marjolaine\u0027 Italian \u0027maggiorana\u0027 Portuguese \u0027manjerona\u0027 Spanish \u0027mejorana\u0027 , from \u0027majorana\u0027 from Latin \u0027amaracus\u0027 from Ancient greek (to 1453) \u0027ἀμάρακος\u0027 Compare Sanskrit \u0027मरुव\u0027 (marjoram) with influence from Latin \u0027major\u0027 (greater)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A herb of the mint family, having aromatic leaves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The leaves of this plant used in flavouring food\", \"priority\":2}]}, \"synonyms\":{}}");

	add("market", "{\"term\":\"market\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"etruscan\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"Latin\", \"old norse\", \"old frisian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|market}}, from Old english (ca. 450-1100) {{m|ang|market||market}} and {{m|fro|markiet}} (Old french (842-ca. 1400) {{m|fro|marchié}}, modern {{m|fr|marché}}); both ultimately from Latin {{m|la|mercātus||trade, market}}, from {{m|la|mercor||I trade, deal in, buy}}, itself derived from {{m|la|merx||wares, merchandise}}, from the Italic root {{m|itc-pro|*merk-}}, possibly stemming from Etruscan referring to various aspects of economics. Cognate with Old frisian {{m|ofs|merked||market}}, Old high german (ca. 750-1050) {{m|goh|markat||market}}, Old norse {{m|non|markaðr||market}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"City square or other fairly spacious site where traders set up stalls and buyers browse the merchandise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d\u0026amp;lsquo;I understand that the district was considered a sort of sanctuary,\u0026amp;rsquo; the Chief was saying. \u0026amp;lsquo;\u0026amp;nbsp;[\u0026amp;hellip;]\u0026amp;nbsp;They tell me there was a recognized swag \u0027\u0027market\u0027\u0027 down here.\u0026amp;rsquo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/world/2013/jul/23/mexico-insect-cuisine-sustainable-food Mexico gets a taste for eating passage\u003dThe San Juan \u0027\u0027market\u0027\u0027 is Mexico City\u0027s most famous deli of exotic meats, where an adventurous shopper can hunt down hard-to-find critters such as ostrich, wild boar and crocodile. Only the city zoo offers greater species diversity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An organised, often periodic, trading event at such site\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Definition used by famous economist of the Austrian school, Ludwig Von Mises, in his book [http://www.mises.org/humanaction/chap15sec1.asp Human Action\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027market\u0027\u0027 is a process, actuated by the interplay of the actions of the various individuals cooperating under the division of labor\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"flea Flea marke\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A group of potential customers for one\u0027s product\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"There is a third thing to be considered: how a \u0027\u0027market\u0027\u0027 can be created for produce, or how production can be limited to the capacities of the market\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A geographical area where a certain commercial demand exists\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A formally organized, sometimes monopolistic, system of trading in specified goods or effects\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21598997-american-regulators-should-block-comcasts-proposed-deal-time-warner-cable-turn-it Turn it passage\u003dIf the takeover is approved, Comcast would control 20 of the top 25 cable \u0027\u0027markets\u0027\u0027, […]. Antitrust officials will need to consider Comcast’s status as a monopsony (a buyer with disproportionate power), when it comes to negotiations with programmers, whose channels it pays to carry\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The sum total traded in a process of individuals trading for certain commodities\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The price for which a thing is sold in a market; hence, value; worth\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"What is a man / If his chief good and \u0027\u0027market\u0027\u0027 of his time / Be but to sleep and feed\", \"priority\":17}]}, \"synonyms\":{}}");

