	add("markhor", "{\"term\":\"markhor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Hindi\", \"Urdu\"], \"text\":\"File:Markhor.jpg|thumb|A markhorFrom Hindi {{m|hi|मारख़ोर|tr\u003dmārxor|sc\u003dDeva}} and Urdu {{m|ur|مارخور|tr\u003dmārxor|sc\u003dur-Arab}}, from Persian {{m|fa|مارخور|tr\u003dmârxor|sc\u003dfa-Arab}} (lit. snake-eater), from {{m|fa|مار|tr\u003dmâr|sc\u003dfa-Arab||snake}} + {{m|fa|خور|tr\u003dxor|sc\u003dfa-Arab}}, present stem of verb {{m|fa|خوردن|tr\u003dkhordan|sc\u003dfa-Arab||to eat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large wild goat, found in the western Himalayas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘Only a Subaltern’, \u0027Under the Deodars\u0027, Folio Society 2005, page 69\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was taught the legends of the Mess Plate, from the great grinning Golden Gods that had come out of the Summer Palace in Pekin to the silver-mounted \u0027\u0027markhor\u0027\u0027-horn snuff-mull presented by the last CO\", \"priority\":3}]}, \"synonyms\":{}}");

	add("markup", "{\"term\":\"markup\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027mark up\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The notation that is used to indicate how text should be displayed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Creative Commons, \u0027[http://creativecommons.org/license/cc-gpl Creative Commons GNU GPL]\u0027\u0026lt;!-- I derived the date from http://creativecommons.org/weblog/entry/3921 --\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You can display the icon on any site you offer your software for download using the following \u0027\u0027markup\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The percentage or amount by which a seller hike hikes up his buy-in price when determining his selling price\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You don’t make much money selling gas because the \u0027\u0027markup\u0027\u0027 is so low\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An increase in price\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There will be a \u0027\u0027markup\u0027\u0027 on those products next week; better buy them now\", \"priority\":7}]}, \"synonyms\":{}}");

