	add("marlin", "{\"term\":\"marlin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any species of game fish belonging to either of the genera or . Every such species has a pointed, spear-like projection of the upper jaw\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marlpit", "{\"term\":\"marlpit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|marl|pit|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pit where marl has been dug\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marmalade", "{\"term\":\"marmalade\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\", \"Portuguese\"], \"text\":\"From French \u0027marmelade\u0027 from Portuguese \u0027marmelada\u0027 (quince jam) from \u0027marmelo\u0027 (quince) from Latin \u0027melimelum\u0027 (sweet apple) from Ancient greek (to 1453) \u0027μελίμηλον\u0027 from \u0027μέλι\u0027 (honey) + \u0027μῆλον\u0027 (apple)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Citrus fruit variant of jam but distinguished by being made slightly bitter by the addition of the peel and by partial caramelisation during manufacture. Most commonly made with Seville oranges, and usually qualified by the name of the fruit when made with other types of fruit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lime marmalade\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"thick cut marmalade\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marmarosis", "{\"term\":\"marmarosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μάρμαρος\u0027 {{suffix||osis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The metamorphosis of limestone into marble\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marmoset", "{\"term\":\"marmoset\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027marmouset\u0027 (lang\u003dfr) probably from \u0027marmouser\u0027 () of imitative origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small monkey, now specifically a Central and South American monkey of the genera \u0027Callithrix\u0027, , or , with claws instead of nails, and a rather primitive layout\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hideous figure; a grotesque\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An unappealing or foolish man\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marmot", "{\"term\":\"marmot\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"Latin\", \"Romansch\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027marmote\u0027, from Old french (842-ca. 1400) \u0027marmotaine, marmontaine, murmontain\u0027, from Old Franco-Provençal \u0027marmotan\u0027, \u0027mures montani\u0027, from Latin \u0027mus monti\u0027 \u0027mountain rat\u0027, from Classical Latin \u0027\u0027 akin to Romansch (Engadine) \u0027\u0027 Old high german (ca. 750-1050) \u0027muremunto\u0027 German dialectal \u0027\u0027 standard \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several large ground-dwelling rodents of the genera \u0027Marmota\u0027 and in the squirrel family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marog", "{\"term\":\"marog\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sotho\"], \"text\":\"From Sotho \u0027marog\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several edible plants of the \u0027Amaranthus\u0027 genus, used locally in South Africa as spinach\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Amaranthus hybridus\u0027 (Figure 38) and other Amaranthus species are either grown for their seeds (Inca wheat) or harvested as spinach (\u0027\u0027marog\u0027\u0027). Most species used in these ways are naturalised weeds in this country and are easily cultivated. The leaves of all species are edible and are a valuable source of protein and vitamin A. The leaves of Amaranthus are more valuable than any other leaf vegetables in terms of their food value, being exceptionally high in iron and calcium. [http://www.fao.org/ag/agp/agpc/doc/Show/SAfrica/sapaper/saessay.htm\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"HERE in sunny South Africa amaranth is better known as \u0027\u0027marog\u0027\u0027 and is used extensively as a nourishing \u0027spinach\u0027 vegetable. [http://www.dispatch.co.za/2003/04/12/features/GARDEN.HTM\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Other materials used by the Tsongas are readily available from the environment. The inhabitants of the kraal plant their own mealies and store them, use sorghum in beer production, \u0027\u0027marog\u0027\u0027 (wild spinach) is eaten, porridge is made from mealies and marula nuts are eaten when other food is scarce. [http://www.tzaneeninfo.co.za/infodetail.asp?idpass\u003d390\", \"priority\":4}]}, \"synonyms\":{}}");

	add("maroquin", "{\"term\":\"maroquin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French alteration of \u0027marocain\u0027 (moroccan) where the leather was first produced.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"leather made from goatski\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919,\u0027\u0027 , \u0027\u0027, Duckworth, hardback edition, page 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Oscillating freely a long chair incense swinger, a youthful server, magnificent in white silk stockings and Neapolitan-violet \u0027\u0027maroquin\u0027\u0027 shoes, presented himself on the threshold in a fragrant veil of smoke\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marplot", "{\"term\":\"marplot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|mar|plot|lang\u003den}}. In earliest use as a character name in \u0027The Busy Body\u0027,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dxWILAAAAIAAJ\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003d%22the+busy+body%22+centlivre\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dX66BSoLbNZCqkASxxqSaC. v\u003donepage\u0026amp;q\u003d\u0026amp;f\u003dfalse]\u0026lt;/sup\u0026gt; by {{w|Susanna Centlivre}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A meddlesome person whose activity interferes with the plans of others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter X\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“The old \u0027\u0027marplot\u0027\u0027 has discovered the baby,” Monica whispered. “I suppose it cried and woke him up, and now he thinks he\u0027s witness to a miracle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, ‘Keeping the Flame Alive’, \u0027Literary Review\u0027, 402\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Unthinking Anglo-Saxons regard him as a Gallic \u0027\u0027marplot\u0027\u0027, rather than the great twentieth-century statesman he was – certainly the greatest Frenchman since Napoleon\", \"priority\":5}]}, \"synonyms\":{}}");

	add("marquess", "{\"term\":\"marquess\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See \u0027\u0027 for etymology. Note also that \u0027marquess\u0027 is very rare in the English language in that it ends in \u0027\u0027 but is a masculine term. The title is granted only to males (the female equivalent is \u0027\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A title of nobility, ranking beneath a duke and above an earl\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marquetry", "{\"term\":\"marquetry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027marqueterie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A decorative technique in which veneers of wood, ivory, metal etc. are inlaid into a wood surface to form intricate designs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An example of this wor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1944\u0027\u0027, w:W. Somerset W. Somerset Maugham, \u0027w:The Razor\u0027s The Razor\u0027s Edge\u0027, Doubleday Doran, [http://books.google.com/books?id\u003dtMZZRjK6fq8C\u0026amp;pg\u003dPT14\u0026amp;dq\u003dmarquetry+commode+maugham\u0026amp;hl\u003den\u0026amp;ei\u003dHEh2TsruKMbdgQeJ6IWgCA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CDYQ6AEwA\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Unkind people asserted that everything in his apartment was for sale and that after he had invited wealthy Americans for an excellent lunch, with vintage wines, one or two of his valuable drawings would disappear, or a \u0027\u0027marquetry\u0027\u0027 commode would be replaced by one in lacquer\", \"priority\":5}]}, \"synonyms\":{}}");

	add("marram", "{\"term\":\"marram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse {{m|non|maralmr}}, a compound of {{m|non|marr|gloss\u003dsea}} and {{m|non|halmr|gloss\u003dstraw, reed}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Ammophila thumb|right|\u0027\u0027Marram\u0027\u0027 grass on sand dunes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a coarse grass found on sandy beaches\", \"priority\":2}]}, \"synonyms\":{}}");

	add("marrano", "{\"term\":\"marrano\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027marrano\u0027 of disputed origin. Perhaps a transferred use of \u0027marrano\u0027 () but many sources consider them distinct words.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the Sephardi Jews who stayed in Iberia during the Spanish Inquisition, and continued to practice Judaism in secret\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027The Case for God\u0027, Vintage 2010, p. 161\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the Portuguese universities, the \u0027\u0027Marranos\u0027\u0027 had studied logic, physics, medicine and mathematics, but they had no expertise in the more intuitive disciplines of Jewish practice\", \"priority\":3}]}, \"synonyms\":{}}");

	add("marriage", "{\"term\":\"marriage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) {{m|fro|mariage}},\u0026lt;ref\u0026gt;{{R:Etymonline}}\u0026lt;/ref\u0026gt; from {{m|fro|marier||to marry}},\u0026lt;ref\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;Dictcom\u0026quot;\u0026gt;{{R:Dictionary.com}}\u0026lt;/ref\u0026gt; from Latin {{m|la|marito||to marry|lit\u003dgive in marriage}}, from {{m|la|maritus||lover”, “nuptial}}, from {{m|la|mas||male, masculine, of the male sex}}.\u0026lt;ref\u0026gt;http://www.myetymology.com/english/marriage.html\u0026lt;/ref\u0026gt; Equivalent to {{suffix|marry|age|lang\u003den}}.\u0026lt;ref name\u003d\u0026quot;Dictcom\u0026quot; /\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;!--Note: If you wish to edit this definition PLEASE keep in mind issues of POV and NPOV; please read up on some of the conversation from the talk page and discuss it there first. --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being married. \u0026lt;!--etymonline actually has the original sense as \u0026quot;act of marrying\u0026quot;, distinct from \u0026quot;wedding\u0026quot;--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You should enter \u0027\u0027marriage\u0027\u0027 for love\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A union of two or more people that creates a family tie and carries legal and/or social rights and responsibilities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1944\u0027\u0027\u0026lt;!--or is this the next sense, \u0026quot;wedding\u0026quot;? anyway, it verifies especially the \u0027two or more\u0027 part--\u0026gt;, Tiaki Hikawera Mitira, \u0027Takitimu\u0027, page 123\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"By his \u0027\u0027marriage\u0027\u0027 to his two wives, Tapuwae quietly strengthened all of the \u0027pas\u0027 of the Wairoa district, as many of them came under his control through these unions\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027\u0026lt;!--or is this the next sense, \u0026quot;wedding\u0026quot;? anyway, it verifies especially the \u0027two or more\u0027 part--\u0026gt;, John Stevens, \u0027Lust for enlightenment: Buddhism and sex\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One layman in Buddha\u0027s time decided to embrace celibacy and relinquished his \u0027\u0027marriage\u0027\u0027 vows to his four wives. When he asked them what they wanted in terms of a settlement, one said\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027\u0026lt;!--or is this the next sense, \u0026quot;wedding\u0026quot;? anyway, it verifies especially the \u0027two or more\u0027 part--\u0026gt;, Edith Deen, \u0027All of the women of the Bible\u0027, page 275\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The account of the loss of the blessing of his father Isaac appears immediately after Esau\u0027s \u0027\u0027marriage\u0027\u0027 to his Hittite wives\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Charles Zastrow, \u0027Introduction to Social Work and Social Welfare: Empowering People\u0027 (ISBN 0495809527), page 30\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In an open open \u0027\u0027marriage\u0027\u0027, the partners are free to have extramarital relationships or sex without betraying one another. Such a marriage is based on communication, trust, and respect\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The union of any two people, to the exclusion of all others\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"quot;I have a patient right now whose \u0027\u0027marriage\u0027\u0027 proved to be a tragedy. She wanted love, sexual gratification, children, and social prestige; but life blasted all her hopes. Her husband didn\u0027t love her. He refused even to eat with her, and forced her to serve his meals in his room upstairs. She had no children, no social standing. She went insane; and, in her imagination, she divorced her husband and resumed her maiden name. She now believes she has married into the English aristocracy, and she insists on being called Lady Smith\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"My grandparents\u0027 \u0027\u0027marriage\u0027\u0027 lasted for forty years\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Pat and Leslie\u0027s \u0027\u0027marriage\u0027\u0027 to each other lasted forty years\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The union of one man and one woman, to the exclusion of all others\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A wedding; a ceremony in which people wed\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"You are cordially invited to the \u0027\u0027marriage\u0027\u0027 of James Smith and Jane Doe\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A close union\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Edmund E. Jacobitti, \u0027The Classical Heritage in Machiavelli\u0027s Histories\u0027, in \u0027The comedy and tragedy of Machiavelli: essays on the literary works\u0027 (edited by Vickie B. Sullivan), page 181\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"And this \u0027\u0027marriage\u0027\u0027 of poetry and history remained a solid relationship throughout the classical period\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Paul Mattick, \u0027Art in its time: theories and practices of modern aesthetics\u0027, page 105\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Above all, we will no longer have to feel qualms about the \u0027\u0027marriage\u0027\u0027 of art and money. We will no longer have to wonder if it is possible to separate the esthetic value of an art work from its commercial value\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 August 9, Amy Scattergood, \u0027A wild dream in the wild\u0027, published in the \u0027Los Angeles Times\u0027, republished in \u0027\u00272009\u0027\u0027 in \u0027The Big Sur Bakery Cookbook: A Year in the Life of a Restaurant\u0027 (by Michelle and Phillip Wojtowicz and Michael Gilson with Catherine Price), on the cover\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"But the food is real: a \u0027\u0027marriage\u0027\u0027 of local ingredients and serious technique\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A joining of two parts\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A king and a queen, when held as a hand in Texas hold \u0027em or melded in pinochle\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"In solitaire or patience games, the placing a card of the same suit on the next one above or below it in value\", \"priority\":29}]}, \"synonyms\":{}}");

	add("marsh", "{\"term\":\"marsh\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"for someone living by a\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marsala", "{\"term\":\"marsala\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"sauce\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marseilles", "{\"term\":\"marseilles\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027marseille\u0027 from Latin \u0027massilia\u0027 \u0027marsilia\u0027 from Ancient greek (to 1453) \u0027μασσαλία\u0027 probably from a pre-Latin language of Italy, perhaps Ligurian mas \u0026quot;spring.\u0026quot; {{rfe|where did the /r/ come from? also where did the English \u0027-s\u0027 come from?|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"City in France, capital of the department Bouches-du-Rhône\", \"priority\":1}]}, \"synonyms\":{}}");

	add("marsha", "{\"term\":\"marsha\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a spelling variant of Marcia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 w:John John Barth, \u0027Where Three Roads Meet: Novellas\u0027, ISBN 0618610163, page 83\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I hate my name, too,\u0026quot; offered four-year-old \u0027\u0027Marsha\u0027\u0027, who until that moment had never thought about her name\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;No, you don\u0027t.\u0026quot; Mom. \u0026quot; It\u0027s a lovely name.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Is not.\u0026quot; But in fact, like most people, she had no particular feelings about her name - her first name, anyhow - but simply accepted it as hers\", \"priority\":5}]}, \"synonyms\":{}}");

	add("marsupial", "{\"term\":\"marsupial\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027\u0027 (marsupium, marsuppium) from Ancient greek (to 1453) \u0027μαρσύπιον\u0027 or \u0027μαρσύππιον\u0027 variants of \u0027μαρσίππιον\u0027 diminutive of \u0027μάρσιππος\u0027 (bag, pouch) with English \u0027\u0027 (-al)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mammal of which the female has a pouch in which it rears its young, which are born immature, through early infancy, such as the kangaroo or koala, or else pouchless members of the Marsupialia like the shrew opposum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("martel", "{\"term\":\"martel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) {{m|fro|martel}} (modern French {{m|fr|marteau}}), from {{m|la|martellus}}, from Latin {{m|la|martulus}}, a variant of {{m|la|marculus||small hammer}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hammer, especially a war hammer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("martha", "{\"term\":\"martha\", \"etymology\":{\"influencers\":[], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027martha\u0027 from Ancient greek (to 1453) \u0027μάρθα\u0027 () from Official aramaic (700-300 bce) \u0027מַרְתָּא\u0027 (tr\u003dmartā) from {{m|arc|מרה}} (\u0026lt;small\u0026gt;\u0027MRH\u0027\u0026lt;/small\u0026gt;) \u0026quot;mistress\u0026quot;, feminine of {{m|arc|מרי}} (\u0026lt;small\u0026gt;\u0027MRY\u0027\u0026lt;/small\u0026gt;) \u0026quot;master\u0026quot;.\u0026lt;!-- these are in small caps because I have no vowels for them; if you add the vowels, please remove the \u0027small\u0027 tags. {{unsigned}} --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027, Agatha Christie: \u0027The Labours of Hercules\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They wanted to call her Helen, but I did put my foot down there. Knowing what her mother and father looked like! I tried hard for \u0027\u0027Martha\u0027\u0027 or Dorcas or something sensible - but it was no good - waste of breath\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sister of Lazarus and Mary in the New Testament\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Luke 10: 40-42\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But \u0027\u0027Martha\u0027\u0027 was cumbered about much serving, and came to him, and said, Lord, dost thou not care that my sister hath left me to serve alone? Bid her therefore that she help me. And Jesus answered and said unto her, \u0027\u0027Martha, Martha\u0027\u0027, thou art careful and troubled about many things: But one thing is needful\", \"priority\":6}]}, \"synonyms\":{}}");

	add("marthambles", "{\"term\":\"marthambles\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Apparently coined by a Dr. Tufts of early 18th-century London, as the name of one of five diseases his medicine was claimed to be able to cure.According to C.J.S. Thompson\u0027s \u0026quot;The Quacks of Old London\u0026quot; (page 100), the marthambles is one of several nonexistent diseases invented by Dr. Tufts in a pamphlet circa 1700 in order to sell his tonics and medicines. Other diseases mentioned in Tufts\u0027 pamphlet are the \u0026quot;Strong Fives\u0026quot;, the \u0026quot;Moon Pall\u0026quot;, and the \u0026quot;Hockogrockle\u0026quot;. Tufts claimed to have encountered these diseases on his travels over a period of forty years, and that he could cure them all.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular ailment unknown to, and uncurable by, medical scienc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"circa \u0027\u00271700\u0027\u0027, Dr. Tufts, handbill, as reproduced in \u0027[http://babel.hathitrust.org/cgi/pt?id\u003dmdp.39015058691034 Relics of Literature]\u0027 by Ruben Percy, published 1828, page 218\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These are to give notice, (for the benefit of the public,) that there is newly arrived from his travels, a gentleman, who, after above forty years\u0027 study, hath, by a wonderful blessing on his endeavours, discovered, as well the nature as the infallible cure of several strange diseases, which (though as yet not known to the world) he will plainly demonstrate to any ingenious artist, to be the greatest causes of the most common distempers incident to the body of man. The names of which take as follow : / The strong fives / The \u0027\u0027marthambles\u0027\u0027 / The moon-pall / The hockogrocle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Abse, a member of the afterguard, whose complaint was known as the \u0027\u0027marthambles\u0027\u0027 at sea and griping of the guts by land, a disease whose cause Stephen did not know and whose symptoms he could only render more nearly bearable by opiates\", \"priority\":4}]}, \"synonyms\":{}}");

	add("martianism", "{\"term\":\"martianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Martian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A minor movement in British poetry in the late 1970s and early 1980s, a kind of surrealism in which familiar things are described in unfamiliar ways\", \"priority\":1}]}, \"synonyms\":{}}");

	add("martinism", "{\"term\":\"martinism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of mystical and esoteric Christianity concerned with the fall of the first man, his state of material privation from his divine source, and the process of his return\", \"priority\":1}]}, \"synonyms\":{}}");

	add("martinmas", "{\"term\":\"martinmas\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Martin|mas|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"St Martin\u0027s day, 11th November. A Scottish quarter day\", \"priority\":1}]}, \"synonyms\":{}}");

	add("martyr", "{\"term\":\"martyr\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) itself from {{m|la|martyr}}, from Ancient greek (to 1453) {{m|grc|μάρτυρ}}, later form of {{m|grc|μάρτυς||witness}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who willingly accepts being put to death for adhering openly to one\u0027s religious beliefs; notably, saints canonized after martyrdom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Saint Stephen was the first Christian \u0027\u0027martyr\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who sacrifices his or her life, station, or something of great personal value, for the sake of principle or to sustain a cause\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who suffers greatly and/or constantly, even involuntarily\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Stan is a \u0027\u0027martyr\u0027\u0027 to arthritis, Chris a \u0027\u0027martyr\u0027\u0027 to Stan\u0027s endless moaning about it\", \"priority\":5}]}, \"synonyms\":{}}");

	add("martyrdom", "{\"term\":\"martyrdom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|martyrdome}}, {{m|enm|martirdom}}, {{m|enm|marterdom}}, from Old english (ca. 450-1100) {{m|ang|martyrdōm||martyrdom}}, corresponding to {{suffix|martyr|dom|lang\u003den}}. Cognate with German {{m|de|Märtyrertum||martyrdom}}, Danish {{m|da|martyrdom||martyrdom}}, Swedish {{m|sv|martyrdom||martyrdom}}, Norwegian {{m|no|martyrdom||martyrdom}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of a martyr; the death of a martyr; the suffering of death on account of adherence to the Christian faith, or to any cause\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Affliction; torment; torture.\u0026lt;!-- webster 1913 defs --\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("marua", "{\"term\":\"marua\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of small-grained cereal from India, similar to millet\", \"priority\":1}]}, \"synonyms\":{}}");

