	add("marvel", "{\"term\":\"marvel\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"First attested from w:1300|1300, from Middle english (1100-1500) \u0027marvail\u0027 from Old french (842-ca. 1400) \u0027merveille\u0027 (a wonder) from {{m|la|*miribilia}}, from Latin \u0027mirabilia\u0027 (wonderful things) from neuter plural of \u0027mirabilis\u0027 (strange, wonderful) from \u0027miror\u0027 (i wonder at) from \u0027mirus\u0027 (wonderful)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which causes wonder; a prodigy; a miracle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Exodus xxxiv. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I will do \u0027\u0027marvels\u0027\u0027 such as have not been done\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wonder, astonishment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Use lessens \u0027\u0027marvel\", \"priority\":6}]}, \"synonyms\":{}}");

	add("marvelverse", "{\"term\":\"marvelverse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|marvel|verse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fictional universe which serves as the setting for the comics, films, and television series\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Roz Kaveney, \u0027Superheroes!: Capes and Crusaders in Comics and Films\u0027, I. B. Tauris Co. Ltd (2008), ISBN 9781845115692, [https://books.google.ca/books?id\u003d2dMbAQAAIAAJ\u0026amp;q\u003d%22marvelverse%22 page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the \u0027\u0027Marvelverse\u0027\u0027, mutants are potential victims of hate crimes and of state-sponsored pogroms, and of the sort of bureaucratic prying that is often a prelude to the latter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jennifer K. Stuller, \u0027Ink-stained Amazons and Cinematic Warriors: Superwomen in Modern Mythology\u0027, I. B. Tauris \u0026amp; Co. Ltd (2010), ISBN 9780857732088, [https://books.google.com/books?id\u003dpK33AgAAQBAJ\u0026amp;pg\u003dPT182\u0026amp;dq\u003d%22marvelverse%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Marvelverse\u0027\u0027 characters Araña Corazon and Elektra Natchios were raised by single fathers after the deaths of their mothers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, \u0026quot;Glossary\u0026quot;, in \u0027The Comics of Joss Whedon: Critical Essays\u0027 (ed. Valerie Estelle Frankel), McFarland \u0026amp; Company (2015), ISBN 9781476621937, [https://books.google.com/books?id\u003droneCQAAQBAJ\u0026amp;pg\u003dPA224\u0026amp;dq\u003d%22marvelvverse%22 page 224\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Licensed crossovers often appear between characters in the \u0027\u0027Marvelverse\u0027\u0027 or the Buffyverse\", \"priority\":7}]}, \"synonyms\":{}}");

	add("marvin", "{\"term\":\"marvin\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"Welsh\", \"English\"], \"text\":\"From Welsh \u0027merfyn\u0027 (mervyn) probably from \u0027mer\u0027 (marrow) + \u0027myn\u0027 (eminent)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 Douglas Adams: \u0027The Hitch Hiker\u0027s Guide to the Galaxy: Chapter 11\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Thank you the marketing division of the Sirius Cybernetic Corporation,\u0026quot; said \u0027\u0027Marvin\u0027\u0027 and trudged desolately up the gleaming curved corridor that stretched out before them. \u0026quot;\u0027Let\u0027s build robots with Genuine People personalities\u0027, they said. So they tried out with me. I\u0027m a personality prototype. You can tell can\u0027t you?\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A village in North Carolina\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in South Dakota\", \"priority\":4}]}, \"synonyms\":{}}");

